import React, { useState, useEffect } from 'react';
import { 
  ArrowUpIcon, 
  ArrowDownIcon, 
  ClockIcon,
  CubeIcon,
  BanknotesIcon,
  DocumentTextIcon
} from '@heroicons/react/24/outline';
import { Chart as ChartJS, ArcElement, Tooltip, Legend, CategoryScale, LinearScale, PointElement, LineElement, Title, Filler } from 'chart.js';
import { Doughnut, Line } from 'react-chartjs-2';
import { getDashboardStats, getEventHistory } from '../services/api';

// Register ChartJS components
ChartJS.register(ArcElement, Tooltip, Legend, CategoryScale, LinearScale, PointElement, LineElement, Title, Filler);

const Dashboard = () => {
  const [stats, setStats] = useState({
    totalEvents: 0,
    significantEvents: 0,
    processedEvents: 0,
    aiInsights: 0
  });

  const [eventTypes, setEventTypes] = useState({
    nft_mint: 0,
    nft_transfer: 0,
    coin_transfer: 0,
    collection_creation: 0,
    other: 0
  });

  const [recentEvents, setRecentEvents] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [eventHistory, setEventHistory] = useState([]);
  const [error, setError] = useState(null);

  // Fetch dashboard data
  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setIsLoading(true);
        const data = await getDashboardStats();
        setStats(data.stats);
        setEventTypes(data.eventTypes);
        setRecentEvents(data.recentEvents);

        // Fetch event history for the chart
        const history = await getEventHistory();
        setEventHistory(history);

        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setError('Failed to load dashboard data. Please try again later.');
        setIsLoading(false);

        // Fallback to sample data for development
        setStats({
          totalEvents: 124,
          significantEvents: 47,
          processedEvents: 42,
          aiInsights: 38
        });

        setEventTypes({
          nft_mint: 12,
          nft_transfer: 18,
          coin_transfer: 9,
          collection_creation: 3,
          other: 5
        });

        setRecentEvents([
          {
            id: 1,
            type: 'nft_transfer',
            description: 'NFT transferred to account',
            account: '0x0108bc32f7...267d6b',
            timestamp: '2025-03-15T00:32:14',
            status: 'processed'
          },
          {
            id: 2,
            type: 'coin_transfer',
            description: 'Coins deposited to account',
            account: '0x2c7bccf7b...010a2',
            timestamp: '2025-03-15T00:28:45',
            status: 'processed'
          },
          {
            id: 3,
            type: 'nft_mint',
            description: 'New NFT minted',
            account: '0x0108bc32f7...267d6b',
            timestamp: '2025-03-15T00:25:12',
            status: 'processed'
          },
          {
            id: 4,
            type: 'collection_creation',
            description: 'New NFT collection created',
            account: '0x0108bc32f7...267d6b',
            timestamp: '2025-03-15T00:20:33',
            status: 'processed'
          },
          {
            id: 5,
            type: 'other',
            description: 'Blockchain event',
            account: '0x1',
            timestamp: '2025-03-15T00:15:21',
            status: 'ignored'
          }
        ]);

        // Generate event history data for the chart
        const now = new Date();
        const historyData = [];
        for (let i = 0; i < 24; i++) {
          const time = new Date(now.getTime() - (23 - i) * 60 * 60 * 1000);
          historyData.push({
            time: time.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' }),
            count: Math.floor(Math.random() * 10)
          });
        }
        setEventHistory(historyData);
      }
    };

    fetchDashboardData();

    // Set up polling for real-time updates
    const interval = setInterval(() => {
      fetchDashboardData();
    }, 30000); // Poll every 30 seconds

    return () => clearInterval(interval);
  }, []);

  // Set up real-time updates with polling
  useEffect(() => {
    const interval = setInterval(() => {
      // In a real app, you would fetch updates from your API
      // For now, let's just simulate a new event occasionally
      if (Math.random() > 0.7) {
        const newEvent = {
          id: recentEvents.length + 1,
          type: ['nft_transfer', 'coin_transfer', 'nft_mint', 'collection_creation', 'other'][Math.floor(Math.random() * 5)],
          description: 'New event detected',
          account: '0x0108bc32f7...267d6b',
          timestamp: new Date().toISOString(),
          status: Math.random() > 0.3 ? 'processed' : 'pending'
        };

        setRecentEvents(prev => [newEvent, ...prev.slice(0, 4)]);
        setStats(prev => ({
          ...prev,
          totalEvents: prev.totalEvents + 1,
          significantEvents: prev.significantEvents + (Math.random() > 0.5 ? 1 : 0)
        }));
      }
    }, 5000);

    return () => clearInterval(interval);
  }, [recentEvents]);

  // Prepare chart data
  const doughnutData = {
    labels: ['NFT Mints', 'NFT Transfers', 'Coin Transfers', 'Collection Creations', 'Other'],
    datasets: [
      {
        data: [
          eventTypes.nft_mint,
          eventTypes.nft_transfer,
          eventTypes.coin_transfer,
          eventTypes.collection_creation,
          eventTypes.other
        ],
        backgroundColor: [
          'rgba(54, 162, 235, 0.8)',
          'rgba(75, 192, 192, 0.8)',
          'rgba(255, 206, 86, 0.8)',
          'rgba(153, 102, 255, 0.8)',
          'rgba(255, 159, 64, 0.8)'
        ],
        borderColor: [
          'rgba(54, 162, 235, 1)',
          'rgba(75, 192, 192, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(153, 102, 255, 1)',
          'rgba(255, 159, 64, 1)'
        ],
        borderWidth: 1,
      },
    ],
  };

  const lineData = {
    labels: eventHistory.map(item => item.time),
    datasets: [
      {
        fill: true,
        label: 'Events',
        data: eventHistory.map(item => item.count),
        borderColor: 'rgb(53, 162, 235)',
        backgroundColor: 'rgba(53, 162, 235, 0.2)',
        tension: 0.4
      },
    ],
  };

  const lineOptions = {
    responsive: true,
    plugins: {
      legend: {
        display: false,
      },
      title: {
        display: false,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        ticks: {
          precision: 0
        }
      }
    }
  };

  // Helper function to get status color
  const getStatusColor = (status) => {
    switch (status) {
      case 'processed':
        return 'bg-green-100 text-green-800';
      case 'pending':
        return 'bg-yellow-100 text-yellow-800';
      case 'ignored':
        return 'bg-gray-100 text-gray-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  // Helper function to get event type icon
  const getEventTypeIcon = (type) => {
    switch (type) {
      case 'nft_mint':
      case 'nft_transfer':
        return <DocumentTextIcon className="h-5 w-5 text-blue-500" />;
      case 'coin_transfer':
        return <BanknotesIcon className="h-5 w-5 text-yellow-500" />;
      case 'collection_creation':
        return <CubeIcon className="h-5 w-5 text-purple-500" />;
      default:
        return <ClockIcon className="h-5 w-5 text-gray-500" />;
    }
  };

  if (isLoading) {
    return (
      <div className="flex justify-center items-center h-96">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-primary-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Stats cards */}
      <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-4">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0 bg-primary-100 rounded-md p-3">
                <ClockIcon className="h-6 w-6 text-primary-600" aria-hidden="true" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Total Events</dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">{stats.totalEvents}</div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
          <div className="bg-gray-50 px-4 py-4 sm:px-6">
            <div className="text-sm">
              <span className="font-medium text-primary-600 hover:text-primary-900">
                View all events
              </span>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0 bg-green-100 rounded-md p-3">
                <ArrowUpIcon className="h-6 w-6 text-green-600" aria-hidden="true" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Significant Events</dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">{stats.significantEvents}</div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
          <div className="bg-gray-50 px-4 py-4 sm:px-6">
            <div className="text-sm">
              <span className="font-medium text-green-600 hover:text-green-900">
                {Math.round((stats.significantEvents / stats.totalEvents) * 100)}% of total
              </span>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0 bg-blue-100 rounded-md p-3">
                <ArrowDownIcon className="h-6 w-6 text-blue-600" aria-hidden="true" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">Processed Events</dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">{stats.processedEvents}</div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
          <div className="bg-gray-50 px-4 py-4 sm:px-6">
            <div className="text-sm">
              <span className="font-medium text-blue-600 hover:text-blue-900">
                {Math.round((stats.processedEvents / stats.significantEvents) * 100)}% of significant
              </span>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0 bg-purple-100 rounded-md p-3">
                <DocumentTextIcon className="h-6 w-6 text-purple-600" aria-hidden="true" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">AI Insights</dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">{stats.aiInsights}</div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
          <div className="bg-gray-50 px-4 py-4 sm:px-6">
            <div className="text-sm">
              <span className="font-medium text-purple-600 hover:text-purple-900">
                View all insights
              </span>
            </div>
          </div>
        </div>
      </div>

      {/* Charts */}
      <div className="grid grid-cols-1 gap-5 lg:grid-cols-2">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <h3 className="text-lg leading-6 font-medium text-gray-900">Event Types</h3>
            <div className="mt-2 h-64 flex justify-center">
              <div className="w-full max-w-md">
                <Doughnut data={doughnutData} />
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <h3 className="text-lg leading-6 font-medium text-gray-900">Event History (24h)</h3>
            <div className="mt-2 h-64">
              <Line options={lineOptions} data={lineData} />
            </div>
          </div>
        </div>
      </div>

      {/* Recent events */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:px-6">
          <h3 className="text-lg leading-6 font-medium text-gray-900">Recent Events</h3>
          <p className="mt-1 max-w-2xl text-sm text-gray-500">Latest blockchain events detected by the agent.</p>
        </div>
        <div className="border-t border-gray-200">
          <ul className="divide-y divide-gray-200">
            {recentEvents.map((event) => (
              <li key={event.id} className="px-4 py-4 sm:px-6 hover:bg-gray-50">
                <div className="flex items-center justify-between">
                  <div className="flex items-center">
                    <div className="flex-shrink-0">
                      {getEventTypeIcon(event.type)}
                    </div>
                    <div className="ml-4">
                      <div className="text-sm font-medium text-gray-900">{event.description}</div>
                      <div className="text-sm text-gray-500">
                        Account: {event.account}
                      </div>
                    </div>
                  </div>
                  <div className="flex items-center">
                    <div className="mr-4 flex flex-col items-end">
                      <div className="text-sm text-gray-500">
                        {new Date(event.timestamp).toLocaleTimeString()}
                      </div>
                      <div className="text-sm text-gray-500">
                        {new Date(event.timestamp).toLocaleDateString()}
                      </div>
                    </div>
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${getStatusColor(event.status)}`}>
                      {event.status}
                    </span>
                  </div>
                </div>
              </li>
            ))}
          </ul>
        </div>
        <div className="bg-gray-50 px-4 py-4 sm:px-6 text-center">
          <button className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500">
            View All Events
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
